import CrudApp from './components/CrudApp';
import CrudTable from './components/CrudTable';

const initialDb = [
                   {id:1, name: 'Bitcoin', symbol:'BTC'}, 
                   {id:2, name: 'Thether', symbol:'USDT'}, 
                   {id:3, name: 'Litecoin', symbol:'LTC' }
                  ]

function App() {
  return (
    <div>
      <h1>CRUD App</h1>
      <CrudApp/>
      <CrudTable/>
    </div>
  );
}

export default App;
